// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.6.9;


contract MyContract{
    enum State { Waiting, Ready, Active }
    State public state;
    function setState() public {
        state=State.Ready;
    }
    function checkState() public returns(bool) {
        return state == State.Active;
    }
}

